Counting words in the array - How can I query with mongo?<pre><code>&quot;sourceList&quot;: [
        {
           &quot;source&quot; : &quot;hello world, how are you?&quot;,
           &quot;_id&quot; : ObjectId(&quot;5f0eb9946db57c0007841153&quot;)
        },
        {
           &quot;source&quot; : &quot;hello world, I am fine&quot;,
           &quot;_id&quot; : ObjectId(&quot;5f0eb9946db57c0007841153&quot;)
        },
        {
           &quot;source&quot; : &quot;Is it raining?&quot;,
           &quot;_id&quot; : ObjectId(&quot;5f0eb9946db57c0007841153&quot;)
        }
]
</code></pre>
<p>Total words in <code>hello world, how are you?</code> = 5, in <code>hello world, I am fine</code> = 5, and in <code>Is it raining?</code>= 3.</p>
<p>Thus the total number of words = <code>13</code></p>
<p>Is there a mongo query to do this calculation? I could do this using javascript, but is there a direct way to query via mongo?</p>
<p><strong>EDIT</strong></p>
<hr />
<p>Is there a way I can do this query across the documents? For documents obeying specific criteria, I want to run a similar calculation with an added constraint, that words of duplicate sentences are not counted twice. For example,</p>
<p>Document - 1</p>
<pre><code>&quot;sourceList&quot;: [
    {
       &quot;source&quot; : &quot;hello world, how are you?&quot;,
       &quot;_id&quot; : ObjectId(&quot;5f0eb9946db57c0007841153&quot;)
    },
    {
       &quot;source&quot; : &quot;hello world, I am fine&quot;,
       &quot;_id&quot; : ObjectId(&quot;5f0eb9946db57c0007841153&quot;)
    },
    {
       &quot;source&quot; : &quot;Is it raining?&quot;,
       &quot;_id&quot; : ObjectId(&quot;5f0eb9946db57c0007841153&quot;)
    }
]
</code></pre>
<p>Document - 2</p>
<pre><code>  &quot;sourceList&quot;: [
    {
       &quot;source&quot; : &quot;hello world, how are you?&quot;,
       &quot;_id&quot; : ObjectId(&quot;5f0eb9946db57c0007841153&quot;)
    },
    {
       &quot;source&quot; : &quot;hello world, I am fine&quot;,
       &quot;_id&quot; : ObjectId(&quot;5f0eb9946db57c0007841153&quot;)
    },
    {
       &quot;source&quot; : &quot;Is it raining?&quot;,
       &quot;_id&quot; : ObjectId(&quot;5f0eb9946db57c0007841153&quot;)
    }
]
</code></pre>
<p>Here the count still remains the same. The reason being, sentences are exactly same in both the documents. But if we combine Document 1 + Document 3 (given as follows)</p>
<pre><code>&quot;sourceList&quot;: [
    {
       &quot;source&quot; : &quot;Look at the beautiful tiger!&quot;,
       &quot;_id&quot; : ObjectId(&quot;5f0eb9946db57c0007841153&quot;)
    }
]
</code></pre>
<p>The count would come as 13 + 5 (document 3) = 18.</p>

