Pymongo get inserted id's even with duplicate key error<p>I am working on a flask app and using mongodb with it. In one endpoint i took csv files and inserts the content to mongodb with <code>insert_many()</code> . Before inserting i am creating a unique index for preventing duplication on mongodb. When there is no duplication i can reach <code>inserted_ids</code> for that process but when it raises duplication error i get <code>None</code> and i can't get <code>inserted_ids</code> . I am using <code>ordered=False</code> also. Is there any way that allows me to get <code>inserted_ids</code> even with duplicate key error ?</p>
<pre><code>def createBulk(): #in controller
  identity = get_jwt_identity()
  try:
    csv_file = request.files['csv']
    insertedResult = ProductService(identity).create_product_bulk(csv_file)
    print(insertedResult) # this result is None when get Duplicate Key Error
    threading.Thread(target=ProductService(identity).sendInsertedItemsToEventCollector,args=(insertedResult,)).start()
    return json_response(True,status=200)
  except Exception as e:  
    print(&quot;insertedResultErr -&gt; &quot;,str(e))
    return json_response({'error':str(e)},400)
</code></pre>
<pre><code>def create_product_bulk(self,products): # in service
        data_frame = read_csv(products)
        data_json = data_frame.to_json(orient=&quot;records&quot;,force_ascii=False)
        try:
            return self.repo_client.create_bulk(loads(data_json))
        except bulkErr as e:
            print(str(e))
            pass
        except DuplicateKeyError as e:
            print(str(e))
            pass
</code></pre>
<pre><code>def create_bulk(self, products): # in repo
        self.checkCollectionName()
        self.db.get_collection(name=self.collection_name).create_index('barcode',unique=True)
        return self.db.get_collection(name=self.collection_name).insert_many(products,ordered=False)
</code></pre>

